{
  "info": {
    "_postman_id": "a1b2c3d4-e5f6-7890-g1h2-i3j4k5l6m7n8",
    "name": "API Tests",
    "schema": "https://schema.getpostman.com/json/collection/v2.1.0/collection.json"
  },
  "item": [
    {
      "name": "Get All Users",
      "request": {
        "method": "GET",
        "header": [],
        "url": {
          "raw": "{{base_url}}/users",
          "variable": [
            {
              "key": "base_url",
              "value": "https://jsonplaceholder.typicode.com"
            }
          ],
          "host": ["{{base_url}}"],
          "path": ["users"]
        }
      },
      "response": []
    },
    {
      "name": "Get User by ID",
      "request": {
        "method": "GET",
        "header": [],
        "url": {
          "raw": "{{base_url}}/users/1",
          "variable": [
            {
              "key": "base_url",
              "value": "https://jsonplaceholder.typicode.com"
            }
          ],
          "host": ["{{base_url}}"],
          "path": ["users", "1"]
        }
      },
      "response": []
    }
  ],
  "event": [
    {
      "listen": "prerequest",
      "script": {
        "type": "text/javascript",
        "exec": [
          ""
        ]
      }
    },
    {
      "listen": "test",
      "script": {
        "type": "text/javascript",
        "exec": [
          "pm.test(\"Status code is 200\", function () {",
          "    pm.response.to.have.status(200);",
          "});",
          "",
          "pm.test(\"Response has users\", function () {",
          "    const response = pm.response.json();",
          "    pm.expect(response).to.be.an(\"array\");",
          "    pm.expect(response.length).to.be.at.least(1);",
          "});"
        ]
      }
    }
  ],
  "variable": [
    {
      "key": "base_url",
      "value": "https://jsonplaceholder.typicode.com"
    }
  ]
}

